import React from 'react';



class App extends Component{

  constructor(props) {
    super(props);
    this.state = {
      cartList: []
    };
  }


  render() {
    return (
      <div className="App">
        <header className="App-header">
          <h1>Welcome to Shop-R-Us!</h1>


        </header>
      </div>
    );
  }

}

export default App;
